import React, { Component } from "react";
import UploadShape from "./uploadShape";
class Shapes extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <UploadShape addShape={this.props.addShape}></UploadShape>
      </div>
    );
  }
}

export default Shapes;
